package com.integrosys.cms.ui.creditriskparam.internallimit.dimension;import com.integrosys.base.uiinfra.common.CommonForm;public class DimensionForm extends CommonForm implements java.io.Serializable {	private String subLimitType;	private String description;	private String limitCurrency;	private String limitAmount;	private String lastReviewedDate;	public String getSubLimitType() {		return subLimitType;	}	public void setSubLimitType(String subLimitType) {		this.subLimitType = subLimitType;	}	public String getDescription() {		return description;	}	public void setDescription(String description) {		this.description = description;	}	public String getLimitCurrency() {		return limitCurrency;	}	public void setLimitCurrency(String limitCurrency) {		this.limitCurrency = limitCurrency;	}	public String getLimitAmount() {		return limitAmount;	}	public void setLimitAmount(String limitAmount) {		this.limitAmount = limitAmount;	}	public String getLastReviewedDate() {		return lastReviewedDate;	}	public void setLastReviewedDate(String lastReviewedDate) {		this.lastReviewedDate = lastReviewedDate;	}	public String[][] getMapper() {		return new String[][] { {				"theDimension",				"com.integrosys.cms.ui.creditriskparam.internallimit.item.InternalLimitItemMapper" } };	}}